<script>
    function uaredirect(f) {
        try {
            if (document.getElementById("bdmark") != null) {
                return
            }
            var b = false;
            if (arguments[1]) {

                } else {

                    }

            }

    function isSubdomin(c, d) {
        this.getdomin = function (f) {
            var e = f.indexOf("://");
            if (e > 0) {
                var h = f.substr(e + 3)
            } else {
                var h = f
            }
            var g = /^www\./;
            if (g.test(h)) {
                h = h.substr(4)
            }
            return h
        };
        if (c == d) {
            return 1
        } else {
            var c = this.getdomin(c);
            var b = this.getdomin(d);

                return 1

                if (b.match(a)) {
                    return 2
                } else {
                    return 0
                }
            }
        }
    };
